import React from 'react';
import SearchTrails from './searchTrails'
import { Routes, Route, Link } from 'react-router-dom';


function Home() {
  return (
    
    <div>
    <h1>Welcome to the Home Page</h1>
     <Routes>
     <Route path="/searchTrails" element={<SearchTrails />} />
    </Routes>
    </div>
  );
}

export default Home;
